BEGIN;
CREATE TABLE IF NOT EXISTS django_migrations (id INT AUTO_INCREMENT NOT NULL PRIMARY KEY, app VARCHAR(255) NOT NULL, name VARCHAR(255) NOT NULL, applied datetime NOT NULL);
CREATE TABLE IF NOT EXISTS auth_group_permissions (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, group_id INT NOT NULL REFERENCES auth_group (id)ON DELETE CASCADE, permission_id INT NOT NULL REFERENCES auth_permission (id)ON DELETE CASCADE);
CREATE TABLE IF NOT EXISTS auth_user_groups (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, user_id INT NOT NULL REFERENCES auth_user (id)ON DELETE CASCADE, group_id INT NOT NULL REFERENCES auth_group (id)ON DELETE CASCADE);
CREATE TABLE IF NOT EXISTS auth_user_user_permissions (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, user_id INT NOT NULL REFERENCES auth_user (id)ON DELETE CASCADE, permission_id INT NOT NULL REFERENCES auth_permission (id)ON DELETE CASCADE);
CREATE TABLE IF NOT EXISTS django_admin_log (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, action_time datetime NOT NULL, object_id text NULL, object_repr VARCHAR(200) NOT NULL, change_message text NOT NULL, content_type_id INT NULL REFERENCES django_content_type (id)ON DELETE CASCADE, user_id INT NOT NULL REFERENCES auth_user (id)ON DELETE CASCADE, action_flag smallint unsigned NOT NULL CHECK (action_flag >= 0));
CREATE TABLE IF NOT EXISTS django_content_type (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, app_label VARCHAR(100) NOT NULL, model VARCHAR(100) NOT NULL);
CREATE TABLE IF NOT EXISTS auth_permission (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, content_type_id INT NOT NULL REFERENCES django_content_type (id)ON DELETE CASCADE, codename VARCHAR(100) NOT NULL, name VARCHAR(255) NOT NULL);
CREATE TABLE IF NOT EXISTS auth_group (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, name VARCHAR(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS django_session (session_key VARCHAR(40) NOT NULL PRIMARY KEY, session_data text NOT NULL, expire_date datetime NOT NULL);
CREATE TABLE IF NOT EXISTS auth_user (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, password VARCHAR(128) NOT NULL, last_login datetime NULL, is_superuser bool NOT NULL, username VARCHAR(150) NOT NULL UNIQUE, last_name VARCHAR(150) NOT NULL, email VARCHAR(254) NOT NULL, is_staff bool NOT NULL, is_active bool NOT NULL, date_joined datetime NOT NULL, first_name VARCHAR(150) NOT NULL);
CREATE TABLE IF NOT EXISTS onlineshop_espece (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, nom VARCHAR(200) NOT NULL, slug VARCHAR(200) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS onlineshop_portegreffe (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, nom VARCHAR(200) NOT NULL, slug VARCHAR(200) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS onlineshop_spec (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, nom VARCHAR(200) NOT NULL, slug VARCHAR(200) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS onlineshop_variete (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, nom VARCHAR(200) NOT NULL, slug VARCHAR(200) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS order_cartdb (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, qte INT NOT NULL, prix decimal NOT NULL, commande_id INT NOT NULL REFERENCES order_commande (id)ON DELETE CASCADE, produit_id bigint NOT NULL REFERENCES onlineshop_produit (id)ON DELETE CASCADE, total_line decimal NOT NULL);
CREATE TABLE IF NOT EXISTS order_statut (
	id	INT NOT NULL UNIQUE,
	nom	TEXT NOT NULL UNIQUE,
	PRIMARY KEY(id AUTO_INCREMENT)
);
CREATE TABLE IF NOT EXISTS onlineshop_produit (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, nom VARCHAR(200) NOT NULL, slug VARCHAR(200) NOT NULL, description text NOT NULL, stock INT NOT NULL, available bool NOT NULL, espece_id bigint NOT NULL REFERENCES onlineshop_espece (id)ON DELETE CASCADE, portegreffe_id bigint NOT NULL REFERENCES onlineshop_portegreffe (id)ON DELETE CASCADE, spec_id bigint NULL REFERENCES onlineshop_spec (id)ON DELETE CASCADE, variete_id bigint NOT NULL REFERENCES onlineshop_variete (id)ON DELETE CASCADE, prix decimal NOT NULL);
CREATE TABLE IF NOT EXISTS order_client (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, nom VARCHAR(250) NOT NULL, prenom VARCHAR(250) NOT NULL, adresse text NOT NULL, cp VARCHAR(5) NOT NULL, ville VARCHAR(250) NOT NULL, tel VARCHAR(20) NOT NULL, mail VARCHAR(250) NOT NULL, commentaire text NOT NULL, remise decimal NOT NULL, user_id INT NULL REFERENCES auth_user (id)ON DELETE CASCADE);
CREATE TABLE IF NOT EXISTS order_frais (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, nom VARCHAR(250) NOT NULL, prix decimal NOT NULL, tva decimal NOT NULL);
CREATE TABLE IF NOT EXISTS order_commande (id INT NOT NULL PRIMARY KEY AUTO_INCREMENT, date datetime NOT NULL, remise decimal NOT NULL, total decimal NOT NULL, client_id bigint NOT NULL REFERENCES order_client (id)ON DELETE CASCADE, statut_id bigint NOT NULL REFERENCES order_statut (id)ON DELETE CASCADE, date_update datetime NOT NULL, tva decimal NOT NULL, frais_id bigint NULL REFERENCES order_frais (id)ON DELETE CASCADE);
